CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_insert_cliente` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `dni_` VARCHAR(50))  NO SQL
BEGIN 
SELECT @existe := (SELECT COUNT(*) FROM cliente WHERE dni = dni_);
IF @existe = 0 THEN 
	INSERT INTO persona (nombre, apellido, telefono) 
    VALUE (nombre_, apellido_, telefono_);
    SELECT @id_ultimo_cliente := @@identity AS idpersona; 
    INSERT INTO cliente (idpersona, dni, fecha) VALUE (@id_ultimo_cliente, dni_, NOW());
ELSE SELECT 'existe';
END IF; 
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_insert_productoventa` (IN `idventa_` INT, IN `idproducto_` INT, IN `cantidad_` INT)  NO SQL
BEGIN
INSERT INTO producto_venta(idventa, idproducto, cantidad) VALUES(idventa_, idproducto_, cantidad_);
UPDATE producto SET stock = (stock - cantidad_)
WHERE idproducto = idproducto_;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_insert_usuarios` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `rol_` VARCHAR(20), IN `email_` VARCHAR(120), IN `password_` VARCHAR(200))  NO SQL
BEGIN 
SELECT @existe := (SELECT COUNT(*) FROM usuarios WHERE email = email_);
IF @existe = 0 THEN 
	INSERT INTO persona (nombre, apellido, telefono) 
    VALUE (nombre_, apellido_, telefono_);
    SELECT @id_ultimo_cliente := @@identity AS idpersona; 
    INSERT INTO usuarios (idpersona, rol, email, password) VALUE (@id_ultimo_cliente, rol_, email_, password_);
ELSE SELECT 'existe';
END IF; 
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_update_acceso` (IN `idpersona_` INT, IN `email_` VARCHAR(130), IN `password_` VARCHAR(200))  NO SQL
BEGIN 
SELECT @existe := (SELECT COUNT(*) FROM usuarios WHERE email = email_ AND idpersona <> idpersona_);
IF @existe = 0 THEN
    UPDATE usuarios SET email = email_, password = password_ WHERE idpersona = idpersona_;
ELSE SELECT 'existe';
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_update_cliente` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `dni_` VARCHAR(45), IN `idpersona_` INT)  NO SQL
BEGIN 
SELECT @existe := (SELECT COUNT(*) FROM cliente WHERE dni = dni_ AND idpersona <> idpersona_);
IF @existe = 0 THEN 
	UPDATE persona SET nombre = nombre_, apellido = apellido_, telefono = telefono_ WHERE idpersona = idpersona_; 
    UPDATE cliente SET dni = dni_ WHERE idpersona = idpersona_;
ELSE SELECT 'existe';
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_update_usuario` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `rol_` VARCHAR(20), IN `idpersona_` INT)  NO SQL
BEGIN 
UPDATE persona SET nombre = nombre_, apellido = apellido_, telefono = telefono_ WHERE idpersona = idpersona_; 
UPDATE usuarios SET rol = rol_ WHERE idpersona = idpersona_;
END$$

